import React from 'react';
import Header from '../components/Header';

class Ecomerce extends React.Component{
    render() {
        return (
          <div>
              <Header />
              <section>
                <img  className='logoGQF' alt='logoGQF'/>
                </section>
                <section>Produção Artesanal Familiar</section>
                <img alt='Luminária Preta' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/240401097_4239697366109961_804689760312366104_n.jpg?_nc_cat=100&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeG9GTGCvpZzfMZvmWLGnYgmwMUp5e0CcK3AxSnl7QJwrdFhYdbMTCxmLxcVP6xZj75nAWHtTuzWZSilk8N4me5A&_nc_ohc=ZTjBvbQVOoAAX9aZjTr&_nc_ht=scontent.fldb1-1.fna&oh=00_AT98zZJtlX1LARcnrelo6tDRUCWofZ2gLuxBXMLcb2hugA&oe=6224900B`}></img>
              </div>
        )
    }
}

export default Ecomerce;
